function getGlobalsDelta(){const e={};for(const t in gear)e[t]=gear[t].map(e=>({id:e.id,dps:e.dps,selected:e.selected,hidden:e.hidden}));const t={};for(const e in enchant)t[e]=enchant[e].map(e=>({id:e.id,dps:e.dps,selected:e.selected,hidden:e.hidden}));return{talents:talents.map(e=>({t:e.t.map(e=>e.c)})),buffs:buffs.filter(e=>e.active).map(e=>e.id),rotation:spells,gear:e,enchant:t}}function updateGlobals(e){for(let t in e.talents)for(let s in e.talents[t].t)talents[t].t[s].c=e.talents[t].t[s];for(let t of e.buffs)for(let e of buffs)t==e.id&&(e.active=!0);for(let t of e.rotation)for(let e of spells)if(t.id==e.id)for(let s in t)e[s]=t[s];for(let t in e.gear)for(let s of e.gear[t])if(gear[t])for(let e of gear[t])s.id==e.id&&(e.dps=s.dps,e.selected=s.selected,e.hidden=s.hidden);for(let t in e.enchant)for(let s of e.enchant[t])for(let e of enchant[t])s.id==e.id&&(e.dps=s.dps,e.selected=s.selected,e.hidden=s.hidden);for(let t in e.resistances)e.resistances[t]&&($(".resistances-list.hidden").removeClass("hidden"),$(".js-toggle[data-id='resistances-list']").addClass("active"),$(".resistances[data-id='"+t+"-resist']").click())}